function LogstatsLogger(t,e){this.webUrl=t,this.projectToken=e,this.Levels={DEBUG:"debug",INFO:"info",NOTICE:"notice",WARNING:"warning",ERROR:"error",CRITICAL:"critical",ALERT:"alert",EMERGENCY:"emergency"}}LogstatsLogger.prototype.debug=function(t,e){this.log(this.Levels.DEBUG,t,e)},LogstatsLogger.prototype.info=function(t,e){this.log(this.Levels.INFO,t,e)},LogstatsLogger.prototype.notice=function(t,e){this.log(this.Levels.NOTICE,t,e)},LogstatsLogger.prototype.warning=function(t,e){this.log(this.Levels.WARNING,t,e)},LogstatsLogger.prototype.error=function(t,e){this.log(this.Levels.ERROR,t,e)},LogstatsLogger.prototype.critical=function(t,e){this.log(this.Levels.CRITICAL,t,e)},LogstatsLogger.prototype.alert=function(t,e){this.log(this.Levels.ALERT,t,e)},LogstatsLogger.prototype.emergency=function(t,e){this.log(this.Levels.EMERGENCY,t,e)},LogstatsLogger.prototype.log=function(t,e,o){var s=this.createRecord(t,e,o);this.send(s)},LogstatsLogger.prototype.send=function(t){var e=new XMLHttpRequest;e.open("POST",this.webUrl,!0),e.setRequestHeader("Content-type","application/x-www-form-urlencoded"),e.send("project="+this.projectToken+"&messages="+JSON.stringify([t]))},LogstatsLogger.prototype.createRecord=function(t,e,o){return{level:t,message:e,context:o,time:Math.floor(Date.now()/1e3)}};